import React from 'react';

export const Todo = ({ todo, onDelete }) => {
  return (
    <div>
      <h4>{todo.title}</h4>
      <p style={{ color: '21054b' }}>{todo.desc}</p>
      <button className="btn btn-sm btn-danger" onClick={() => { onDelete(todo) }}>Delete</button>
    </div>
  );
}

export default Todo;
